import React from "react";
import logo from './logo.svg';
import './App.css';
import Topbar from './components/navbar';
import CallToAction from './components/callToAction';
import {FeaturescardCircle,
  Featurescardemergency,
  FeaturescardPin,
  FeaturescardAlert,
  FeaturescardGetMeOut,
  FeaturescardPrivacy} from '../src/components/features/featurescard';

function App() {
  return (
    <>
    <Topbar />
    <CallToAction />
    <FeaturescardCircle/>
    <Featurescardemergency/>
    <FeaturescardPin/>
    <FeaturescardAlert/>
    <FeaturescardGetMeOut/>
    <FeaturescardPrivacy/>
    </>
  );
}

export default App;
